import NavBar from "./components/Navbar/NavBar";  
import Footer from "./components/Footer/Footer";  
import ItemListContainer from "./components/ItemListContainer/ItemListContainer";


import React from "react";
import axios from "axios"

function App() {
  const [teclados, setTeclados]= React.useState([])
const [bulldog, setBullDog] = React.useState([])
const [mouses, setMouses]= React.useState([])
React.useEffect(()=>{
//Esto hace que se realice una sola vez la petición


fetch("https://api.mercadolibre.com/sites/MLA/search?q=teclados")
.then((response)=>response.json())
.them((json) => setTeclados(json))

axios.get("https://api.mercadolibre.com/sites/MLA/search?q=nouse")
.then((response)=>setMouses(response.results))


axios.get("https://dog.ceo/api/breeds/list/all").then(res =>{
  setBullDog(res.data.message.bulldog)
})
},[])



  return (

    <div className="App">
      <NavBar/>
      <main>
        <ItemListContainer/>
        {bulldog.map((b)=>(<h1>{b}</h1>))}
      </main>
      <Footer/>
    </div>

  )
}

export default App;
